defs.script:

function mouseover(evt) {
    var circle = document.getElementByID(circle_id);
}

function alter(type, evt, item_id) 
{
    var colour;

    var svgDoc = evt.target.ownerDocument;
    var svgObj = svgDoc.getElementById(item_id)

    switch (type)
	{
	case 'mouseover':
	    colour = "red";

	    break;
	case 'mouseout':
	    colour = "grey";
	    break;
	}
	if (svgObj != null)
		{
   		svgObj.style.setProperty("stroke",colour,"important");
   }
}

// todo make native firefox svg compatible
function alter_per(evt, item_id) 
{
    var colour, showhide;
    var svgDoc = evt.target.ownerDocument;
    var svgObj = svgDoc.getElementById("circle"+item_id);
    var outlinks = svgDoc.getElementById("outlinks_"+item_id);

    var keepon = outlinks.getAttribute("keepon");
    switch (evt.getType())
	{
	case 'mouseover':
	    //alert("keepon: " + keepon);
	    if (keepon != "on") {
        svgObj.style.setProperty("stroke","red","important");
        outlinks.setAttribute("display", "inline");
  	  }
	    break;

	case 'click':
  	  //alert("keepon: " + keepon);
	    if (keepon == "on") {
	      keepon = "off";
        svgObj.style.setProperty("stroke", "none", "important");
        outlinks.setAttribute("display", "none");
	    }
	    else {
	      keepon = "on";
        svgObj.style.setProperty("stroke","red","important");
        outlinks.setAttribute("display", "inline");
	    }
      outlinks.setAttribute("keepon", keepon);
	    break;

	case 'mouseout':
	    //alert("keepon: " + keepon);
	    if (keepon != "on") {
        svgObj.style.setProperty("stroke","none","important");
        outlinks.setAttribute("display", "none");
  	  }
	    break;
	}


}

//generic function for changing the display status of an object
function layerOnOff(layerName) {
	var layerObj = document.getElementById(layerName);

	var layerStatus = layerObj.style.getPropertyValue("display");

	if(layerStatus == "show"){
		layerObj.style.setProperty('display','none','important');
	}
	else{
		layerObj.style.setProperty('display','block','important');
	}
}

function statsOnOff(nSite){
	if(linksDisplayed){
		statsOnOff_linksOn(nSite);
	}
	else{
		statsOnOff_linksOff(nSite);
		resetNodeDisplayStatus();
	}
}

//current active site
var siteActiv = -1;
var siteActivState = -1;

//function for changing the display status of a node statistics data when links are on
function statsOnOff_linksOn(nSite){
	var layerObj;

	if(siteActiv >= 0){
		//previous node
		//hide stats
		layerObj = document.getElementById("site"+siteActiv);

		layerObj.style.setProperty('display','none','important');

		//un-bold name
		layerObj = document.getElementById("siteName"+siteActiv);

		layerObj.style.setProperty("font-weight","normal","important");

		//reset links page number
		showNodesSet(1, 0);
		showNodesSet(2, 0);

		//change circle profile
		layerObj = document.getElementById("siteCircle"+siteActiv);

		layerObj.style.setProperty('fill',layerObj.style.getPropertyValue('stroke'),"important");
		layerObj.style.setProperty('stroke',"grey","important");
		layerObj.style.setProperty("stroke-width","1","important");
	}

	//save site number
	siteActiv = nSite;

	//current node
	//show stats
	layerObj = document.getElementById("site"+nSite);

	layerObj.style.setProperty('display','block','important');

	//bold name
	layerObj = document.getElementById("siteName"+nSite);

	layerObj.style.setProperty("font-weight","bold","important");

	//change circle profile
	layerObj = document.getElementById("siteCircle"+nSite);

	layerObj.style.setProperty("stroke",layerObj.style.getPropertyValue("fill"),"important");
	layerObj.style.setProperty("fill","#ffffff","important");
	layerObj.style.setProperty("stroke-width","4","important");

	//hide & translate links to network
	layerObj = document.getElementById("site"+siteActiv+"_Links1");

	layerObj.style.setProperty('display','none','important');
	layerObj.setAttribute("transform", "translate(0,0)");

	//show & translate links from network
	layerObj = document.getElementById("site"+siteActiv+"_Links2");

	layerObj.style.setProperty('display','block','important');
	layerObj.setAttribute("transform", "translate(0,0)");

	//show URL links to network
	layerObj = document.getElementById("site"+siteActiv+"_Links_URL1");

	layerObj.style.setProperty('display','block','important');
	//layerObj.setAttribute("transform", "translate(0,0)");

	//hide URL links from network
	layerObj = document.getElementById("site"+siteActiv+"_Links_URL2");

	layerObj.style.setProperty('display','none','important');
	//layerObj.setAttribute("transform", "translate(0,0)");

	//modify statistics panel
	layerObj = document.getElementById("statistics_panel");
	layerObj.style.setProperty('display','block','important');
	layerObj.setAttribute("height", 155+node_link_stats[siteActiv]['from_net']);

	//show statistics headline
	layerObj = document.getElementById("statistics_headline");
	layerObj.style.setProperty('display','block','important');

	//translate save panel
	layerObj = document.getElementById("save_panel");
	if(layerObj) {
		layerObj.setAttribute("transform", "translate(0,-"+(550-155-node_link_stats[siteActiv]['from_net'])+")");
	}
}

//function for changing the display status of a node statistics data when links are off
function statsOnOff_linksOff(nSite){
	var layerObj;
	var oldSiteActiv = siteActiv;
	var changeSite = true;

	if((siteActiv >= 0) && (siteActiv != nSite)){
		siteActiv = nSite;
		siteActivState = 1;
	}
	else{
		if(siteActiv == -1){
			siteActiv = nSite;
			siteActivState = 1;
		}
		else{
			changeSite = false;

			siteActivState++;
			if(siteActivState == 5){
				siteActivState = 1;
			}
		}
	}

	if(changeSite){
		//
		//change status of the previous node
		//

		if(oldSiteActiv >= 0){
			//hide stats
			layerObj = document.getElementById("site"+oldSiteActiv);

			layerObj.style.setProperty('display','none','important');

			//hide links 1
			layerObj = document.getElementById("site"+oldSiteActiv+"_Links1");

			layerObj.style.setProperty('display','none','important');

			//hide links 2
			layerObj = document.getElementById("site"+oldSiteActiv+"_Links2");

			layerObj.style.setProperty('display','none','important');

			//hide URL links 1
			layerObj = document.getElementById("site"+siteActiv+"_Links_URL1");

			layerObj.style.setProperty('display','none','important');

			//hide URL links 2
			layerObj = document.getElementById("site"+siteActiv+"_Links_URL2");

			layerObj.style.setProperty('display','none','important');

			//reset links page number
			var savedSiteActiv = siteActiv;
			siteActiv = oldSiteActiv;
			showNodesSet(1, 0);
			showNodesSet(2, 0);
			siteActiv = savedSiteActiv;

			//un-bold name
			layerObj = document.getElementById("siteName"+oldSiteActiv);

			layerObj.style.setProperty("font-weight","normal","important");

			//change circle profile
			layerObj = document.getElementById("siteCircle"+oldSiteActiv);

			layerObj.style.setProperty('fill',layerObj.style.getPropertyValue('stroke'),"important");
			layerObj.style.setProperty('stroke',"grey","important");
			layerObj.style.setProperty("stroke-width","1","important");
		}

		//
		//change status of the new active node
		//

		//show stats
		layerObj = document.getElementById("site"+siteActiv);

		layerObj.style.setProperty('display','block','important');

		//bold name
		layerObj = document.getElementById("siteName"+siteActiv);

		layerObj.style.setProperty("font-weight","bold","important");

		//change circle profile
		layerObj = document.getElementById("siteCircle"+siteActiv);

		layerObj.style.setProperty("stroke",layerObj.style.getPropertyValue("fill"),"important");
		layerObj.style.setProperty("fill","#ffffff","important");
		layerObj.style.setProperty("stroke-width","4","important");
	}

	//reset links page number
	showNodesSet(1, 0);
	showNodesSet(2, 0);

	//hide URL links 1
	layerObj = document.getElementById("site"+siteActiv+"_Links_URL1");

	layerObj.style.setProperty('display','none','important');

	//hide URL links 2
	layerObj = document.getElementById("site"+siteActiv+"_Links_URL2");

	layerObj.style.setProperty('display','none','important');

	switch(siteActivState){
		case 1:
			//show&translate links 1
			layerObj = document.getElementById("site"+siteActiv+"_Links1");

			layerObj.style.setProperty('display','block','important');
			layerObj.setAttribute("transform", "translate(0,0)");

			//show&translate links 2
			layerObj = document.getElementById("site"+siteActiv+"_Links2");

			layerObj.style.setProperty('display','block','important');
			layerObj.setAttribute("transform", "translate(0,"+node_link_stats[siteActiv]['to_net']+")");

			//modify statistics panel
			layerObj = document.getElementById("statistics_panel");

			layerObj.style.setProperty('display','block','important');
			layerObj.setAttribute("height", 155+node_link_stats[siteActiv]['to_net']+node_link_stats[siteActiv]['from_net']);

			//show statistics headline
			layerObj = document.getElementById("statistics_headline");

			layerObj.style.setProperty('display','block','important');

			//translate save panel
			layerObj = document.getElementById("save_panel");
			layerObj.setAttribute("transform", "translate(0,-"+(550-155-node_link_stats[siteActiv]['to_net']-node_link_stats[siteActiv]['from_net'])+")");

			//show all the links on the map
			for(var i=0; i< node_links.length; i++){
				if((node_links[i]['x1'] == siteActiv) || (node_links[i]['x2'] == siteActiv)){
					layerObj = document.getElementById("siteLink_"+node_links[i]['x1']+'_'+node_links[i]['x2']);

					layerObj.style.setProperty('display','block','important');
				}
				else{
					layerObj = document.getElementById("siteLink_"+node_links[i]['x1']+'_'+node_links[i]['x2']);

					layerObj.style.setProperty('display','none','important');
				}
			}

			break;

		case 2:
			//hide links 1
			layerObj = document.getElementById("site"+siteActiv+"_Links1");

			layerObj.style.setProperty('display','none','important');

			//show links 2
			layerObj = document.getElementById("site"+siteActiv+"_Links2");

			layerObj.style.setProperty('display','block','important');

			//translate links 2
			layerObj = document.getElementById("site"+siteActiv+"_Links2");
			layerObj.setAttribute("transform", "translate(0,0)");

			//show URL links 1
			layerObj = document.getElementById("site"+siteActiv+"_Links_URL1");

			layerObj.style.setProperty('display','block','important');

			//modify statistics panel
			layerObj = document.getElementById("statistics_panel");
			layerObj.setAttribute("height", 155+node_link_stats[siteActiv]['from_net']);

			//translate save panel
			layerObj = document.getElementById("save_panel");
			layerObj.setAttribute("transform", "translate(0,-"+(550-155-node_link_stats[siteActiv]['from_net'])+")");

			//show only the links from the network on the map
			for(var i=0; i< node_links.length; i++){
				if((node_links[i]['x2'] == siteActiv) || ((node_links[i]['x1'] == siteActiv) && (node_links[i]['one_way']==0))){
					layerObj = document.getElementById("siteLink_"+node_links[i]['x1']+'_'+node_links[i]['x2']);

					layerObj.style.setProperty('display','block','important');
				}
				else{
					layerObj = document.getElementById("siteLink_"+node_links[i]['x1']+'_'+node_links[i]['x2']);

					layerObj.style.setProperty('display','none','important');
				}
			}

			break;

		case 3:
			//show links 1
			layerObj = document.getElementById("site"+siteActiv+"_Links1");

			layerObj.style.setProperty('display','block','important');

			//hide links 2
			layerObj = document.getElementById("site"+siteActiv+"_Links2");

			layerObj.style.setProperty('display','none','important');

			//show URL links 2
			layerObj = document.getElementById("site"+siteActiv+"_Links_URL2");

			layerObj.style.setProperty('display','block','important');

			//modify statistics panel
			layerObj = document.getElementById("statistics_panel");
			layerObj.setAttribute("height", 155+node_link_stats[siteActiv]['to_net']);

			//translate save panel
			layerObj = document.getElementById("save_panel");
			layerObj.setAttribute("transform", "translate(0,-"+(550-155-node_link_stats[siteActiv]['to_net'])+")");

			//show only the links to the network on the map
			for(var i=0; i< node_links.length; i++){
				if((node_links[i]['x1'] == siteActiv) || ((node_links[i]['x2'] == siteActiv) && (node_links[i]['one_way']==0))){
					layerObj = document.getElementById("siteLink_"+node_links[i]['x1']+'_'+node_links[i]['x2']);

					layerObj.style.setProperty('display','block','important');
				}
				else{
					layerObj = document.getElementById("siteLink_"+node_links[i]['x1']+'_'+node_links[i]['x2']);

					layerObj.style.setProperty('display','none','important');
				}
			}

			break;

		case 4:
			//hide links 1
			layerObj = document.getElementById("site"+siteActiv+"_Links1");

			layerObj.style.setProperty('display','none','important');

			//hide links 2
			layerObj = document.getElementById("site"+siteActiv+"_Links2");

			layerObj.style.setProperty('display','none','important');

			//modify statistics panel
			layerObj = document.getElementById("statistics_panel");

			layerObj.style.setProperty('display','none','important');
			//layerObj.setAttribute("height", 140);

			//hide statistics headline
			layerObj = document.getElementById("statistics_headline");

			layerObj.style.setProperty('display','none','important');

			//translate save panel
			layerObj = document.getElementById("save_panel");
			layerObj.setAttribute("transform", "translate(0,-"+555+")");

			//hide the links
			for(var i=0; i< node_links.length; i++){
				layerObj = document.getElementById("siteLink_"+node_links[i]['x1']+'_'+node_links[i]['x2']);

				layerObj.style.setProperty('display','none','important');
			}

			//
			//turn off selected node
			//
			//un-bold name
			layerObj = document.getElementById("siteName"+siteActiv);

			layerObj.style.setProperty("font-weight","normal","important");

			//change circle profile
			layerObj = document.getElementById("siteCircle"+siteActiv);

			layerObj.style.setProperty('fill',layerObj.style.getPropertyValue('stroke'),"important");
			layerObj.style.setProperty('stroke',"grey","important");
			layerObj.style.setProperty("stroke-width","1","important");

			//hide stats
			layerObj = document.getElementById("site"+siteActiv);

			layerObj.style.setProperty('display','none','important');

			siteActiv = -1;

			break;
	}
}

//current links display status
var linksDisplayed = true;

//function for changing the links from/to panel that is displayed
function linksStatsOnOff(nLinks){
	var layerObj;
	var linksActive = 0;
	var linksActiveStr = "";

	if(linksDisplayed){
		layerObj = document.getElementById("site" + siteActiv + "_Links1");

		if(layerObj.style.getPropertyValue('display') == 'block'){
			linksActive = 1;
			linksActiveStr = "from_net";
		}
		else{
			linksActive = 2;
			linksActiveStr = "to_net";
		}

		//reset links page number
		showNodesSet(1, 0);
		showNodesSet(2, 0);

		//show links
		layerObj = document.getElementById("site"+siteActiv+"_Links"+(3-linksActive));

		layerObj.style.setProperty('display','block','important');

		//hide links
		layerObj = document.getElementById("site"+siteActiv+"_Links"+linksActive);

		layerObj.style.setProperty('display','none','important');

		//show URL links
		layerObj = document.getElementById("site"+siteActiv+"_Links_URL"+linksActive);

		layerObj.style.setProperty('display','block','important');

		//hide URL
		layerObj = document.getElementById("site"+siteActiv+"_Links_URL"+(3-linksActive));

		layerObj.style.setProperty('display','none','important');

		//modify statistics panel
		layerObj = document.getElementById("statistics_panel");
		layerObj.setAttribute("height", 155+node_link_stats[siteActiv][linksActiveStr]);

		//translate save panel
		layerObj = document.getElementById("save_panel");
		layerObj.setAttribute("transform", "translate(0,-"+(550-155-node_link_stats[siteActiv][linksActiveStr])+")");
	}
	else{
		switch(nLinks){
			case 1:
				siteActivState = 2;
				break;

			case 2:
				siteActivState = 1;
				break;
		}

		statsOnOff(siteActiv);
	}
}

//turning the link on/off
function linksOnOff(){
	for(var i=0; i< node_links.length; i++){
		layerObj = document.getElementById("siteLink_"+node_links[i]['x1']+'_'+node_links[i]['x2']);


		if(linksDisplayed){
			layerObj.style.setProperty('display','none','important');
		}
		else{
			layerObj.style.setProperty('display','block','important');
		}
	}

	if(linksDisplayed){
		linksDisplayed = false;
	}
	else{
		linksDisplayed = true;
	}

	if(!linksDisplayed){
		if(siteActiv > -1){
			//hide links URLs
			layerObj = document.getElementById("site"+siteActiv+"_Links_URL1");

			layerObj.style.setProperty('display','none','important');

			layerObj = document.getElementById("site"+siteActiv+"_Links_URL2");

			layerObj.style.setProperty('display','none','important');

			//display the first state of the stats info
			siteActivState = 0;
			statsOnOff_linksOff(siteActiv);
		}
	}
	else{
		if(siteActiv > -1){
			//display the stats info
			statsOnOff_linksOn(siteActiv);

			//reset node display status
			for(var i=0; i< nodes.length; i++){
				layerObj = document.getElementById("siteCircle"+i);

				layerObj.style.setProperty('display','block','important');

				layerObj = document.getElementById("siteName"+i);

				layerObj.style.setProperty('display','block','important');

				node_types[nodes[i].substr(1)] = 1;
			}
		}
	}
}

//current active node type
var nodeTypeActiv = "";
var nodeTypeActivState = -1;

//handles the onclick event for legend elements
function legendClick(node_type){
	if(linksDisplayed){
		legendClick_LinksOn(node_type);
	}
	else{
		legendClick_LinksOff(node_type);
	}
}

//handles the onclick event for legend elements when links are on
function legendClick_LinksOn(node_type){
	var layerObj;

	if((nodeTypeActiv != "") && (nodeTypeActiv != node_type)){
		nodeTypeActiv = node_type;
		nodeTypeActivState = 1;
	}
	else{
		if(nodeTypeActiv == ""){
			nodeTypeActiv = node_type;
			nodeTypeActivState = 1;
		}
		else{
			nodeTypeActivState++;
			if(nodeTypeActivState == 5){
				nodeTypeActivState = 1;
			}
		}
	}

	switch(nodeTypeActivState){
		case 1:
			for(var i=0; i< node_links.length; i++){
				layerObj = document.getElementById("siteLink_"+node_links[i]['x1']+'_'+node_links[i]['x2']);


				if(node_links[i]['type'].indexOf('.'+node_type+';') != -1){
					layerObj.style.setProperty('display','block','important');
				}
				else{
					layerObj.style.setProperty('display','none','important');
				}
			}

			break

		case 2:
			for(var i=0; i< node_links.length; i++){
				layerObj = document.getElementById("siteLink_"+node_links[i]['x1']+'_'+node_links[i]['x2']);

				if(node_links[i]['type'].indexOf('.'+node_type+';') == 0){
					layerObj.style.setProperty('display','block','important');
				}
				else{
					layerObj.style.setProperty('display','none','important');
				}
			}

			break

		case 3:
			for(var i=0; i< node_links.length; i++){
				layerObj = document.getElementById("siteLink_"+node_links[i]['x1']+'_'+node_links[i]['x2']);


				if(node_links[i]['type'].lastIndexOf('.'+node_type+';') > 0){
					layerObj.style.setProperty('display','block','important');
				}
				else{
					layerObj.style.setProperty('display','none','important');
				}
			}

			break

		case 4:
			//display all the links
			for(var i=0; i< node_links.length; i++){
				layerObj = document.getElementById("siteLink_"+node_links[i]['x1']+'_'+node_links[i]['x2']);

				layerObj.style.setProperty('display','block','important');
			}

			break
	}
}

//handles the onclick event for legend elements when links are off
function legendClick_LinksOff(node_type){
	var layerObj, layerObjText, layerObjLink;
	for(var i=0; i < nodes.length; i++){
		layerObj = document.getElementById("siteCircle"+i);


		//get node display status
		displayStatus = layerObj.style.getPropertyValue('display'); 
		if(nodes[i] == ('.'+node_type)){
			if(layerObj.style.getPropertyValue("display") == "none"){
				displayStatus = "block";
			}
			else{
				hideNode = true;
				for(var j=0; j < node_links.length; j++){
					if((node_links[j]['x1'] == i) || (node_links[j]['x2'] == i)){
						layerObjLink = document.getElementById("siteLink_"+node_links[j]['x1']+'_'+node_links[j]['x2']);

						if(layerObjLink.style.getPropertyValue("display") == "block"){
							hideNode = false;
						}
					}
				}

				displayStatus = "none";
				if(!hideNode){
					displayStatus = "block";
				}
			}
		}

		//change node circle status
		layerObj.style.setProperty("display",displayStatus,"important");

		//change node label status
		layerObjText = document.getElementById("siteName"+i);

		layerObjText.style.setProperty("display", displayStatus,"important");
	}

	if(node_types[''+node_type] == 1){
		node_types[''+node_type] = 0;
	}
	else{
		node_types[''+node_type] = 1;
	}
}

function resetNodeDisplayStatus(){
	var layerObj, layerObjLink;

	for(var i=0; i < nodes.length; i++){
		if(node_types[nodes[i].substr(1)] == 0){
			hideNode = true;
			for(var j=0; j< node_links.length; j++){
				if((node_links[j]['x1'] == i) || (node_links[j]['x2'] == i)){
					layerObjLink = document.getElementById("siteLink_"+node_links[j]['x1']+'_'+node_links[j]['x2']);

					if(layerObjLink.style.getPropertyValue("display") == "block"){
						hideNode = false;
					}
				}
			}

			if(hideNode){
				layerObj = document.getElementById("siteCircle"+i);

				layerObj.style.setProperty('display','none','important');

				layerObj = document.getElementById("siteName"+i);

				layerObj.style.setProperty('display','none','important');
			}
			else{
				layerObj = document.getElementById("siteCircle"+i);

				layerObj.style.setProperty('display','block','important');

				layerObj = document.getElementById("siteName"+i);

				layerObj.style.setProperty('display','block','important');
			}
		}
	}
}

var linksCurrentPage = 0;

function showNodesSet(nSet, nPage){
	var layerObj;
	var subElements;
	var subElement;
	var linksTitle;

	switch(nSet){
		case 1:
			linksTitle = "Links to network";
			break
		case 2:
			linksTitle = "Links from network";
			break
	}

	linksCurrentPage = linksCurrentPage + nPage;

	if((linksCurrentPage*20+1) > link_nodes[siteActiv][nSet].length){
		linksCurrentPage -= 1;
	}

	if(nPage == 0){
		linksCurrentPage = 0;
	}

	if(linksCurrentPage == -1){
		linksCurrentPage = 0;
	}

	if(link_nodes[siteActiv][nSet].length > 0){
		layerObj = document.getElementById("site"+siteActiv+"_Links"+nSet);
		subElements = layerObj.childNodes;

		var textElem = 0;
		var textElemNo = linksCurrentPage*20+1;
		var displayURLLinks = false;
		var linkTextElem = 1;
		for (var i=0; i < subElements.length ; i++){
			subElement = subElements.item(i);
			if(subElement == "[object SVGTextElement]"){
				//change node names
				if(textElem > 0){
					textContent = subElement.firstChild;

